import React from 'react';
import {Image,Input, Label} from 'semantic-ui-react';

function App() {
  return (
    <div className="App">
      <div className='logo'>
        <Image src='../img/logo.png' size='medium' circular />
      </div>
      <div className='searchInput'>
      <Input icon={{ name: 'search', circular: true, link: true }} placeholder='Search...' />
      </div>
    </div>
  );
}

export default App;
